import React from 'react';
import AccountBalanceWalletIcon from '@material-ui/icons/AccountBalanceWallet';
import ContactPhoneIcon from '@material-ui/icons/ContactPhone';
import SearchIcon from '@material-ui/icons/Search';
import FavoriteBorderIcon from '@material-ui/icons/FavoriteBorder';
import AddShoppingCartIcon from '@material-ui/icons/AddShoppingCart';
import SubscriptionsIcon from '@material-ui/icons/Subscriptions';



const Heading = () => {
  return (
      <>
    <div className="heading">
    <div className='account'>
    <div className='wallet'>
    <AccountBalanceWalletIcon/></div>
    <div className='contact'><ContactPhoneIcon/></div>
    </div>
    
    <h2 className='title'>The List of Top 5 Netflix Series</h2>
    <div className='searchbar'> <input type="text" placeholder='search here' className='search'/> <SearchIcon/></div>
    <div className='login'>
    <div className='like'><FavoriteBorderIcon/></div>
    <div className='shop'><AddShoppingCartIcon/></div>
    <div className='subs'><SubscriptionsIcon/></div>
    </div>
    </div>
    </>

  )
}

export default Heading;
